import "../style/Navbar.css";
import { NavLink } from "react-router-dom";
function Navbar() {
  return (
    <nav>
      <h1 className="task">Tasks</h1>
      <nav>
        <li>Incoming</li>
        <li>Today</li>
        <li>Calender</li>
      </nav>
    </nav>
  );
}
export default Navbar;
